import React from 'react';
import { useAuth } from '../context/AuthContext';
import Footer from '../components/Footer';

// Import images from assets (make sure these paths are correct)
import buddy from '../assets/pexels-chevanon-1108099.jpg';
import max from '../assets/pexels-wojciech-kumpicki-1084687-2071873.jpg';
import luna from '../assets/pexels-shvetsa-4587962.jpg';
import whiskers from '../assets/pexels-pixabay-45170.jpg';
import mittens from '../assets/pexels-lum3n-44775-406014.jpg';
import leo from '../assets/pexels-larissa-barbosa-945746-1870376.jpg';

export default function Dashboard() {
  const { user } = useAuth();

  const pets = [
    {
      name: 'Buddy',
      desc: 'Loyal and full of energy!',
      src: buddy,
    },
    {
      name: 'Max',
      desc: 'Snow is his playground!',
      src: max,
    },
    {
      name: 'Luna',
      desc: 'Curious and playful pup.',
      src: luna,
    },
    {
      name: 'Whiskers',
      desc: 'Charming and loves naps.',
      src: whiskers,
    },
    {
      name: 'Mittens',
      desc: 'Elegant and always watching.',
      src: mittens,
    },
    {
      name: 'Leo',
      desc: 'Always on an adventure!',
      src: leo,
    },
  ];

  return (
    <div className="flex flex-col min-h-screen bg-gradient-to-b from-pink-100 via-purple-100 to-blue-100">
      <div className="flex-grow p-6">
        <h1 className="text-3xl font-bold text-center text-pink-700 mb-2">
          <span role="img" aria-label="paw">üêæ</span> Welcome to Pet Clinic
        </h1>
        <p className="text-center text-gray-700 mb-8">
          Logged in as: <strong>{user?.role?.toUpperCase()}</strong>
        </p>

        <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-6 px-4 md:px-12">
          {pets.map((pet, idx) => (
            <div
              key={idx}
              className="bg-white rounded-xl shadow-lg overflow-hidden transform hover:scale-105 transition-all duration-300 hover:shadow-xl"
            >
              <img
                src={pet.src}
                alt={pet.name}
                className="w-full h-52 object-cover"
              />
              <div className="p-4">
                <h3 className="text-xl font-bold text-gray-800">{pet.name}</h3>
                <p className="text-gray-600">{pet.desc}</p>
              </div>
            </div>
          ))}
        </div>
      </div>
      <Footer />
    </div>
  );
}
